import { BrowserRouter, Route, Routes } from 'react-router-dom';
import GameResult from '../pages/gameResult/GameResult';
import GameRoom from '../pages/gameRoom/GameRoom';
import Lobby from '../pages/lobby/Lobby';
import MyPage from '../pages/myPage/MyPage';
import Notice from '../pages/notice/Notice';
import Rank from '../pages/rank/Rank';
import Signin from '../pages/signin/Signin';
import Signup from '../pages/signup/Signup';
import WatingRoom from '../pages/watingRoom/WatingRoom';

export default function Router() {
  return (
    <BrowserRouter>
      <Routes>
        <Route pate="/" element={<Signin />} />
        <Route pate="/signup" element={<Signup />} />
        <Route pate="/lobby" element={<Lobby />} />
        <Route pate="/watingroom" element={<WatingRoom />} />
        <Route pate="/gameroom" element={<GameRoom />} />
        <Route pate="/gameresult" element={<GameResult />} />
        <Route pate="/rank" element={<Rank />} />
        <Route pate="/mypage" element={<MyPage />} />
        <Route pate="/notice" element={<Notice />} />
      </Routes>
    </BrowserRouter>
  );
}
